(16451, 9967, 0, 1, '我不管(DEMO)', '有些時候，別人不懂我們在堅持什麼\r\n    認為我們，只是標新立異的一群人\r\n    \r\n    而在我們心中，自己所追求的\r\n    並不需要他們來期待\r\n    我們就是我們  不要管 他們怎麼看我們', '0000-00-00 00:00:00', 0000, 0, 1, 7, 'a：〈從這角度俯看這世界 混亂 顛倒的秩序〉\r\n    那分辯不出界限 白色 或著混著黑的灰\r\n   〈那無所是事卻為了此舉 而驕傲的人們〉\r\n    從墜落那天起 你們將會 失去最重要的事物\r\n\r\nb：我 不想 再去忍受\r\n\r\n  〈那 變相 且不真實的你們的世界〉\r\n\r\n\r\n主：  為什麼 要用你的 價值來定義\r\n    〈我的路 我的堅定〉\r\n\r\n複： 在我眼前 〈我的世界〉 *用我們的方式來定義絕對\r\n     〈結果 結局 我承受〉\r\n     在我眼前 〈我的世界〉 *用我們的方式來詮釋完美\r\n       不用 你們 來左右\r\n\r\nso：左右我的路 左右我堅持 左右我緊握 的夢 我相信會有出口\r\n    *我相信會有出口\r\n     ', '', 224, '', 'Cigaro', '刀疤,亂', '', '搖滾開跑音樂文化', '', 0, 0, 1, '2009-03-14 00:41:33', '2013-10-07 17:14:40', '0000-00-00 00:00:00'),
