(16453, 315, 0, 1, '哩袂將我送去叨位', '獻給我過世的舅舅', '2010-02-09 00:00:00', 0000, 0, 1, 7, '你要將我送去哪裡　那裡是否有比這還要美麗的花朵\r\n你要將我送去哪裡　那裡是否有比這還要美麗的歌曲\r\n你要將我送去哪裡　那裡是否有比這還要迷人的風景\r\n你要將我送去哪裡　在那裡生活是否有比這還要容易\r\n \r\n那裡是天上嗎　那裡有好喝的啤酒嗎\r\n那裡是地獄嗎　那裡是否有恐怖的牛頭和馬面\r\n\r\n你要將我送去哪裡　在那裡買樂器是否有比較划算\r\n你要將我送去哪裡　我是否曾經去過那個地方\r\n\r\n你要將我送去哪裡　我是否能在那裡遇見心愛的人\r\n', '', 250, '', '小姚', '小姚', '', '', '', 0, 1, 0, '2009-03-14 04:24:40', '2015-03-12 13:38:55', '0000-00-00 00:00:00'),
(16454, 10292, 1778, 1, '城堡-單曲-典藏版', '', '2009-03-14 00:00:00', 0000, 50, 0, 1, '城堡\r\n陳浩\r\n\r\n是誰的出現 讓不安遠離了\r\n只要一個微笑\r\n迷惑就逃跑\r\n是誰的溫柔 那麼的溫暖\r\n恐懼不再騷擾\r\n\r\n是誰的出現 讓孤單遠離了\r\n只要輕輕撒嬌\r\n寂寞就逃跑\r\n是誰的獨特 香水味道\r\n趕走了我的煩惱\r\n\r\n時光像利刀 不斷炫燿\r\n放肆又無情的侵擾\r\n\r\n抵擋不了撒旦的迷藥\r\n心在動搖\r\n所有美好都忘掉\r\n\r\ni need you now\r\n別奪走我的心跳\r\n你是我唯一的依靠\r\n你是我僅有的 溫暖城堡\r\n\r\ni need you now\r\n別輕易逃跑\r\n忘卻不了你的微笑 \r\n你是我唯一的解藥 ', '', 312, '', '陳浩', '陳浩', '陳浩', '', '', 0, 0, 1, '2009-03-14 11:58:00', '2013-10-07 17:14:40', '0000-00-00 00:00:00'),
