(16471, 11364, 0, 4, '能相愛在世界末日之前', '高中時\r\n在徐玫怡的書上\r\n看到他寫的一些沒賣掉的歌詞\r\n每一首都很有趣\r\n特別喜歡這首的歌詞\r\n那時後剛好熱戀中\r\n就想寫一首歌給他\r\n於是就用這首歌詞自己彈彈唱唱\r\n\r\n但後來被他聽到時被笑了 \r\n他說只有4個和弦 \r\n會不會太簡單啊....\r\n\r\n*徐玫怡就是畫交換日記的人喔\r\n 不知道這樣有沒有犯法@@ \r\n 用人家歌詞唱歌\r\n', '0000-00-00 00:00:00', 0000, 0, 2, 6, '能相愛，在世界 末日之前 \r\n\r\n我穿老式的運動鞋\r\n我穿去年買的T恤\r\n我不會美得讓你暈眩 \r\n\r\n人與人之間或許並不了解\r\n表情和內心總在失控的場面 \r\n灰色的天空下 我盡可能說服自己\r\n這樣的一個我 有一天你將會發現 \r\n\r\n我想靠在你身邊\r\n我想親吻你的臉 \r\n我想聽到你說我 很特別\r\n\r\n眼淚流過後多喝水\r\n看不到你就早點上床去睡\r\n活在亞熱帶的人不隱瞞感覺\r\n就在地球轉動的某一天\r\n或許我們能更加了解\r\n能相愛 在世界末日之前 \r\n', '', 0, '', 'happpyanna', '徐玫怡', '', '', '', 0, 0, 1, '2009-03-16 00:05:38', '2013-10-07 17:14:40', '0000-00-00 00:00:00'),
(16472, 11364, 0, 1, '十萬分的男人', '朋友艾倫生日時與朋友一起送給他的歌 \r\n\r\n剛好為我們的樂團之路開了一個頭\r\n因為其實到現在也沒練過團\r\n朋友十分迷戀一個男生她稱他為十萬分的男人 \r\n像是一般美術系男生的分數大概都幾千分而已\r\n但只有這位竟然是十萬分的男人...\r\n\r\n為此我還寫了一篇關於十萬分男人的色情小說\r\n剛好趁著她的生日\r\n與朋友用msn在一個半夜完成了這首歌 \r\n\r\n我們的目標是 \r\n看她哭哭 哈\r\n\r\n*這個版本不是送她的,而是後來再錄的\r\n  但好像還是十分不熟...\r\n\r\n', '0000-00-00 00:00:00', 0000, 0, 2, 6, '十萬分的男人\r\n\r\n其實我忘了從什麼時候開始\r\n愛上默默的關心你的名字\r\n毎天毎天都要上網surfing好幾次\r\n打電話跟朋友分享da la da da\r\n\r\nla la la\r\n\r\n你是一個害羞的處女座男生\r\n不愛出門只是在背後偷偷的蓋著你的城\r\n留下我在黑暗中不停的揣測la la la\r\n\r\n我不懂變化的宇宙\r\n也不懂朋友口中對你的煽動\r\n你有太多難解的小動作\r\n我被時間一點一點淹沒\r\n\r\n你說你想賣掉你的白色腳踏車\r\n我說也許你是一個喜新厭舊的\r\n十萬分的男人', '', 0, '', 'anna', 'stanly', '', '', '', 0, 0, 1, '2009-03-16 00:17:42', '2013-10-07 17:14:40', '0000-00-00 00:00:00'),
