(16501, 1, 1783, 1, '處女空氣(Earth Is Our  Modern Love)', '「迎向世界，才能解放自我。\r\n我們可以選擇，是要做個小集團裡顧影自憐的搖滾失敗者，\r\n或是自許能成為真正感動人心的搖滾客。」\r\n– 回聲樂團\r\n\r\n於是，『紓緩氣候變化』的目標，讓強調獨立、自由的綠色和平，與台灣的回聲樂團，找到了彼此。\r\n\r\n將感動化為行動，回聲樂團以詩人余光中的作品為靈感，擷取「呼吸」的意象，創作新曲《處女空氣》，與綠色和平肩並肩，以『Earth is our modern love』(地球是我們的摩登愛人)為訴求，讓紓緩氣候變化的努力，擲地有聲。', '2009-03-16 00:00:00', 0000, 0, 1, 7, '摩登愛人\r\n請你喚醒我的心\r\n摩登愛人\r\n我願為你轉不停\r\n在這壯麗的天空\r\n為你瘋狂\r\n在這曼妙的星球\r\n為你守望\r\n迎接春天的呼吸\r\n\r\n請你牽著我的手\r\n親吻枯乾的荒漠\r\n此刻處女空氣\r\n將充滿我\r\n\r\n摩登愛人\r\n請你不要再哭泣\r\n摩登愛人\r\n我願為你轉不停\r\n在這驟雨的山丘\r\n為你瘋狂\r\n在這沈睡的夜空\r\n為你守望\r\n迎接生命的奇蹟\r\n\r\n請你牽著我的手\r\n尋喚冰原的行蹤\r\n此刻處女空氣\r\n將充滿我的胸口\r\n就讓我們乘著風\r\n用最浪漫的溫柔\r\n讓雨後的新綠\r\n為你心動\r\n齊聲歌頌\r\n\r\n當千年的美麗\r\n在揮霍中燃燒\r\n用我最虔誠的心願將你擁抱', '', 223, '', '', '', '', '', '', 1, 0, 0, '2009-03-16 15:57:33', '2015-03-12 13:38:56', '0000-00-00 00:00:00'),
(16502, 10292, 1779, 2, '城堡 。典藏版。', '陳浩,城堡\n這是一首 非常獨特的歌曲\n醞釀著綿密的思緒\n迴盪著情緒\n嗓音與吉他交織著\n這是獨有的陳浩風格歌曲...\n優惠加長試聽 全曲播放中 20121023更新\n\n優惠加長試聽II\n播放段落起始時間:0:0 結束時間:2:15\n\n廣告剪輯:\nhttp://www.youtube.com/watch?v=WlqopdHxTws', '2012-09-18 00:00:00', 0000, 50, 0, 1, '城堡\n詞曲演唱演奏編曲製作錄音合聲   /     陳浩 XhenHow\n\n是誰的出現 讓不安遠離了\n只要一個微笑\n迷惑就逃跑\n是誰的溫柔 那麼的溫暖\n恐懼不再騷擾\n\n是誰的出現 讓孤單遠離了\n只要輕輕撒嬌\n寂寞就逃跑\n是誰的獨特 香水味道\n趕走了我的煩惱\n\n時光像利刀 不斷炫燿\n放肆又無情的侵擾\n\n抵擋不了撒旦的迷藥\n心在動搖\n所有美好都忘掉\n\ni need you now\n別奪走我的心跳\n你是我唯一的依靠\n你是我僅有的 溫暖城堡\n\ni need you now\n別輕易逃跑\n忘卻不了你的微笑                          \n你是我唯一的解藥    ', '', 312, '', '陳浩 Xhen How', '陳浩 Xhen How', '陳浩 Xhen How', '陳浩 Xhen How Music', '', 0, 1, 0, '2009-03-16 16:07:52', '2015-03-12 13:38:56', '0000-00-00 00:00:00'),
